import React from 'react';
import '../css/search-panel.css';

const SearchPanel = () => {
    const searchText = 'Type here to search';
    const searchStyle = {
        fontSize: '20px'
    };
    return <input 
                style = {searchStyle}
                placeholder = {searchText}   
            />;
};

export default SearchPanel;
